import React from "react";
function TodoFormCreate()
{
 return(
    <form className="form-create-todo">
        <label>Ingrese su primer TODO</label>
        <textarea
        placeholder="Estudiar nuevos cursos"
        ></textarea>
        <div>
            <button className="btn-class btn-cancel">Cancelar</button>
            <button className="btn-class btn-add">Anadir</button>
        </div>
    </form>
 );
}

export {TodoFormCreate}
